import React from 'react';
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import {makeStyles} from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import styled from 'styled-components'
import SecondaryLayout from "../_layouts/default/SecondaryLayout";

const useStyles = makeStyles(theme => ({
    icon: {
        marginRight: theme.spacing(2),
    },
    heroButtons: {
        marginTop: theme.spacing(4),
    },
    card: {
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
    },
    cardMedia: {
        paddingTop: '56.25%', // 16:9
    },
    cardContent: {
        flexGrow: 1,
    },
}));

const cards = [1, 2, 3, 4, 5, 6, 7];

const CompContainer = styled(Container)`
        padding-top: ${({theme}) => theme.spacing(8)};
        padding-bottom: ${({theme}) => theme.spacing(8)};
`

const PageCaptionSpacer = styled.div`
    padding: ${({theme}) => theme.spacing(2, 0, 2)};
`

function Compositions({...props}) {
    return (
        <SecondaryLayout>
            <PageCaptionSpacer>
                <Container maxWidth="md">
                    <Typography component="h1" variant="h5" align="left" color="textPrimary">
                        Листинг композиций
                    </Typography>
                </Container>
            </PageCaptionSpacer>
            <CompContainer maxWidth="md">
                <Grid container spacing={2}>
                    {cards.map(card => (
                        <CompCard key={card} />
                    ))}
                </Grid>
            </CompContainer>
        </SecondaryLayout>
    );
}

export default Compositions
